/**
 * @file
 * Javascript behaviors for bootstrapping angular application on a page. Automatic angular bootstrapping doesn't work
 * for multiple application in same page. Below bootstrappping is required to make multiple application work in same
 * page.
 */
(function ($, Drupal, window) {
    'use strict';

    Drupal.behaviors.apps = {

        attach: function (context) {

            $(function(){

                //Get all the angular 1 apps in a page
                var apps = $('[data-tni-angular]');

                apps.each(function(index, item){

                    //Bootstrap each of angular 1 apps.
                    angular.bootstrap(item, [$(item).attr('data-tni-angular')]);
                });
            });
        }
    };

})(jQuery, Drupal, window);;
